import React, { useState, useEffect } from 'react';
import { calculateFinalActivation } from '../utils'; // Ensure the correct import path
import ArchitectureSelection from './ArchitectureSelection';
import UserInput from './UserInput';

function NeuralNetwork({ inputValues, architecture = 'FCNN' }) {
  const [hiddenNodes, setHiddenNodes] = useState([
    { id: 'hidden1', x: 300, y: 150, value: 0, weight: 0.5 },
    { id: 'hidden2', x: 300, y: 250, value: 0, weight: 0.4 },
    { id: 'hidden3', x: 300, y: 350, value: 0, weight: -0.2 },
    { id: 'hidden4', x: 300, y: 450, value: 0, weight: 0.1 },
  ]);

  const [outputNode, setOutputNode] = useState({
    id: 'output',
    x: 700,
    y: 300,
    activation: 0,
    color: 'red',
    size: 30,
  });

  const [inputNodeValues, setInputNodeValues] = useState({
    input1: 0,
    input2: 0,
    input3: 0,
  });

  const [inputToHiddenWeights, setInputToHiddenWeights] = useState(() => {
    const weights = [];
    for (let i = 0; i < hiddenNodes.length; i++) {
      weights.push(Array(3).fill(0)); 
    }
    return weights;
  });

  const [inputsComplete, setInputsComplete] = useState(false);
  const [outputNodeValue, setOutputNodeValue] = useState(0);

  const calculateHiddenNodeValue = (hiddenNode, inputNodeValues, edges) => {
    const value = edges
      .filter(edge => edge.target === hiddenNode.id)
      .reduce((acc, edge) => {
        const inputValue = inputNodeValues[edge.source];
        const weight = edge.weight;
        return acc + inputValue * weight;
      }, 0);
    return Math.max(0, value); // ReLU activation
  };

  const calculateOutputNodeValue = () => {
    const summation = hiddenNodes.reduce((acc, hiddenNode) => {
      return acc + hiddenNode.value * hiddenNode.weight; // Calculate output based on hidden nodes
    }, 0);
    return Math.max(0, summation); // Apply ReLU to the output node
  };

  useEffect(() => {
    setInputNodeValues(inputValues);
  }, [inputValues]);

  useEffect(() => {
    if (inputsComplete) {
      const updatedHiddenNodes = hiddenNodes.map((hiddenNode) => {
        const value = calculateHiddenNodeValue(hiddenNode, inputNodeValues, inputToHiddenWeights);
        return { ...hiddenNode, value };
      });
      setHiddenNodes(updatedHiddenNodes);
    }
  }, [inputNodeValues, inputsComplete]);

  const handleInputComplete = () => {
    setInputsComplete(true);
  };

  const handleOutputCalculation = () => {
    const outputValue = calculateOutputNodeValue();
    setOutputNodeValue(outputValue);
  };

  return (
    <div className="NeuralNetwork">
      <div className="t">NN VISION</div>

      <div className="network-container">
        <svg width="800" height="600">
          {/* Drawing Input Nodes */}
          {Object.keys(inputNodeValues).map((input, index) => (
            <g key={input}>
              <circle cx={100} cy={(index + 1) * 210} r={20} fill="green" opacity="0.66" />
              <text x={100} y={(index + 1) * 210} fill="white" textAnchor="middle" alignmentBaseline="central">{`I ${index + 1}`}</text>
              <text x={100} y={(index + 1) * 210 + 30} fill="black" textAnchor="middle" alignmentBaseline="central">{inputNodeValues[input]}</text>
            </g>
          ))}

          {/* Drawing Hidden Nodes */}
          {hiddenNodes.map((hiddenNode, index) => (
            <g key={hiddenNode.id}>
              <circle cx={400} cy={(index + 1) * 175} r={20} fill="blue" opacity="0.66" />
              <text x={400} y={(index + 1) * 175} fill="white" textAnchor="middle" alignmentBaseline="central">{`H${index + 1}`}</text>
              <text x={400} y={(index + 1) * 175 + 30} fill="black" textAnchor="middle" alignmentBaseline="central">{hiddenNode.value.toFixed(2)}</text>
            </g>
          ))}

          {/* Drawing Edges from Input to Hidden Nodes */}
          {hiddenNodes.map((hiddenNode, hIndex) => (
            <g key={`edge-hidden-${hIndex}`}>
              {[...Array(3).keys()].map((i) => (
                <line 
                  key={`input-to-hidden-${i}-${hIndex}`} 
                  x1={100} 
                  y1={(i + 1) * 210} 
                  x2={400} 
                  y2={(hIndex + 1) * 175} 
                  stroke="black" 
                  strokeWidth={2} 
                />
              ))}
            </g>
          ))}

          {/* Drawing Output Node */}
          <circle cx={700} cy={300} r={30} fill={outputNode.color} opacity="0.66" />
          <text x={700} y={300} fill="white" textAnchor="middle" alignmentBaseline="central">Out</text>
          <text x={700} y={330} fill="black" textAnchor="middle" alignmentBaseline="central">{outputNodeValue.toFixed(2)}</text>
        </svg>

        <div className="controls">
          <ArchitectureSelection setArchitecture={setArchitecture} />
          <UserInput setInputValues={setInputNodeValues} />
          <button onClick={handleInputComplete}>Calculate Hidden Values</button>
          <button onClick={handleOutputCalculation}>Calculate Output Value</button>
        </div>
      </div>
    </div>
  );
}

export default NeuralNetwork;
